import React from 'react';
import {getPodcastsFromSpotify} from './../../../services/Api'

const Test = () => {
    const getPodcast = () => {
        getPodcastsFromSpotify({ search: 'the cut' })
            .then((res) => {
                console.log(res)
            })
            .catch(e => console.log(e))
    }
    return (
        <div>
            <button onClick={() => getPodcast()}>Clic</button>
        </div>
    );
};

export default Test;
